import logo from './logo.svg';
import './App.css';
import React, { useState} from 'react';


function App() {
  const [stock, setStock] = useState("MM/DD/YYYY")
  function changeStock(e) {
    setStock(e.target.value)
  }
  const [start, setStart] = useState("MM/DD/YYYY")
  function changeStart(e) {
    setStart(e.target.value)
  }
  const [end, setEnd] = useState("MM/DD/YYYY")
  function changeEnd(e) {
    setEnd(e.target.value)
  }
  return (
    <div className="App">
      <body className='lebody'>
        <label for="stock">Stock Name: </label>
        <input className="date-in" type="text" id="stock" value={ start } onChange= {(e) => changeStock(e)}></input><br></br><br></br>
        <label for="startDate">Start Date: </label>
        <input className="date-in" type="text" id="startDate" value={ start } onChange= {(e) => changeStart(e)}></input><br></br><br></br>
        <label for="endDate">End Date: </label>
        <input className="date-in" type="text" id="endDate" value={ start } onChange= {(e) => changeEnd(e)}></input>
        <p>If you bought {stock} at {start} {end}</p>
      </body>
    </div>
  );
}

export default App;
